  function handleInactivity() {
    // handles inactivity : players will be kicked after afkLimit
    let players = room.getPlayerList().filter((p) => {
      // Verifica se as propriedades do jogador estão definidas
      const player = playerList[p.name];
      return (
        room.getPlayerDiscProperties(p.id) != null &&
        player != null &&
        player.isInTheTrack === true
      );
    });
    if (countAFK && players.length >= 1) {
      for (var i = 0; i < players.length; i++) {
        setActivity(players[i], getActivity(players[i]) + 1);
      }
    }
    for (var i = 0; i < extendedP.length; i++) {
      const selectedPlayer = players.find((p) => p.id == extendedP[i][0]);
      //Confere se o time não é red
      if (
        extendedP[i][eP.ACT] == 60 * ((2 / 3) * afkLimit) &&
        selectedPlayer?.team === 2
      ) {
        room.sendAnnouncement(
          "[PV] ⛔ Se você não se mover ou enviar uma mensagem nos próximos segundos, você será kickado!",
          extendedP[i][eP.ID],
          colors.alert,
          fonts.alert,
          sounds.alert
        );
      }
      if (extendedP[i][eP.ACT] >= 60 * afkLimit && selectedPlayer?.team === 2) {
        extendedP[i][eP.ACT] = 0;
        //          if (room.getScores().time <= afkLimit - 0.5) {
        //              room.stopGame();
        // }
        room.kickPlayer(extendedP[i][eP.ID], "AFK", false);
      }
    }
  }

  function getAFK(player) {
    return extendedP.filter((a) => a[0] == player.id) != null
      ? extendedP.filter((a) => a[0] == player.id)[0][eP.AFK]
      : null;
  }

  function setAFK(player, value) {
    extendedP
      .filter((a) => a[0] == player.id)
      .forEach((player) => (player[eP.AFK] = value));
  }

  function getActivity(player) {
    return extendedP.filter((a) => a[0] == player.id) != null
      ? extendedP.filter((a) => a[0] == player.id)[0][eP.ACT]
      : null;
  }

  function setActivity(player, value) {
    // Verifica se o jogador está no time 2 (Red Team)
    if (player.team !== 1) {
      extendedP
        .filter((a) => a[0] == player.id)
        .forEach((p) => (p[eP.ACT] = value));
    }
  }

  function arrayMin(arr) {
    var len = arr.length;
    var min = Infinity;
    while (len--) {
      if (arr[len] < min) {
        min = arr[len];
      }
    }
    return min;
  }

  function randomNum(min, max) {
    var n = Math.floor(Math.random() * max) + min;
    return n;
  }

