  function ifInLapChangeZone(player) {
    return (
      room.getScores().time > 0 &&
      _Circuit &&
      _Circuit.MinX <= room.getPlayerDiscProperties(player.id).x &&
      room.getPlayerDiscProperties(player.id).x <= _Circuit.MaxX &&
      _Circuit.MinY <= room.getPlayerDiscProperties(player.id).y &&
      room.getPlayerDiscProperties(player.id).y <= _Circuit.MaxY
    );
  }

  function ifInPitLane(player) {
    return (
      room.getScores().time > 0 &&
      _Circuit &&
      _Circuit.LaneMinX <= room.getPlayerDiscProperties(player.id).x &&
      room.getPlayerDiscProperties(player.id).x <= _Circuit.LaneMaxX &&
      _Circuit.LaneMinY <= room.getPlayerDiscProperties(player.id).y &&
      room.getPlayerDiscProperties(player.id).y <= _Circuit.LaneMaxY
    );
  }

  function ifInBoxesZone(player) {
    

    if (gameState != "running") {
      room.sendAnnouncement(
        `Não há corrida no momento.`,
        player.id,
        colors.wrong,
        fonts.wrong,
        sounds.wrong
      );
      return false;
    }

    if (player.team != 2) {
      room.sendAnnouncement(
        `Você não é um piloto.`,
        player.id,
        colors.wrong,
        fonts.wrong,
        sounds.wrong
      );
      return false;
    }

    if (room.getScores().time === 0) {
      return true;
    }

    // Verifica se o jogador está na zona de boxes
    return (
      _Circuit &&
      _Circuit.BoxMinX <= room.getPlayerDiscProperties(player.id).x &&
      room.getPlayerDiscProperties(player.id).x <= _Circuit.BoxMaxX &&
      _Circuit.BoxMinY <= room.getPlayerDiscProperties(player.id).y &&
      room.getPlayerDiscProperties(player.id).y <= _Circuit.BoxMaxY
    );
  }

  function serialize(number) {
    return number.toFixed(3);
  }

  function pointDistance(p1, p2) {
    return Math.hypot(p1.x - p2.x, p1.y - p2.y);
  }

