  room.onGameTick = function () {
    let players = room
      .getPlayerList()
      .filter((p) => room.getPlayerDiscProperties(p.id) != null);

    
    checkPlayerLaps();
    handleInactivity();
    endRaceSession();
    if(speedEnabled == true){
      gripEffect();
    }
    pitSpeedLimit();
    if (currentCircuit == 17 || currentCircuit == 38) {
      teleportSuzuka();
    }
    // drsFunction();

    currentTime += 1 / 60;
    // collisionDetectionSegmentPlayer();
    // runCamera();
    players.forEach((p) => {
      if (room.getScores().time > 0) {
        if(speedEnabled == true){
          checkTyreWear(p);
        }
        updateKers(p);
      }
    });
  };

