  function getRandomEmoji() {
    const emojis = [
      "🎫",
      "👥",
      "🏟️",
      "👨‍👩‍👧‍👦",
      "👀",
      "📣",
      "🙌",
      "🎉",
      "📸",
      "🍿",
      "🍻",
      "🎟️",
      "🎊",
      "🥳",
      "🎽", // Camiseta esportiva
      "🚩", // Bandeira
      "🧢", // Boné
      "🥂", // Taças de champanhe
    ];

    const randomIndex = Math.floor(Math.random() * emojis.length);
    return emojis[randomIndex];
  }

  room.onPlayerJoin = function (player) {
    console.log(`${player.name} has joined`);
    console.log(player.id);

    // Verifica se o nome do jogador é válido
    if (player.name.length > 24) {
      room.kickPlayer(player.id, "Nome muito comprido", false);
      return;
    }

    const allowedCharacters =
      /^[a-zA-Z0-9À-ÿ \-_\.\,\!\?\@\+\$\/\%\*\#\&\(\)\=\[\]\{\}\;\:\'\\"\<\>\|\\\~\^\`]+$/;
    if (!allowedCharacters.test(player.name)) {
      room.kickPlayer(player.id, "Nome com caracteres especiais", false);
      return;
    }

    // Adiciona o jogador à lista de jogadores com configurações básicas
    extendedP.push([player.id, player.auth, player.conn, false, 0, false]);

    // Inicialização básica do jogador
    playerList[player.name] = {
      name: player.name,
      id: player.id,
      currentLap: 0,
      lapChanged: false,
      lapTimes: Array(limit).fill(0),
      inSafetyCar: false,
      kers: 100,
      isInTheRoom: true,
      isInTheTrack: false,
      afk: false,
      tyres: null,
      wear: 0,
      tyreEmoji: "🔴", // Emoji padrão dos pneus
      showDelta: true,
      everyoneLaps: false,
      boxRadio: true,
      everyoneTyres: false,
    };

    // Verifica se o jogo ainda não começou
    if (room.getScores() == null && room.getPlayerList().length == 1) {
      if (_Circuit.Team != 0) {
        room.setPlayerTeam(player.id, _Circuit.Team);
      }
      room.sendAnnouncement(
        "Bem vindo a FTOH, a corrida já vai começar! Use o comando '!ajuda' para ver mais comandos.",
        player.id,
        colors.info,
        fonts.info,
        sounds.info
      );
      room.startGame();
    } else {
      room.setPlayerTeam(player.id, 1);
      room.sendAnnouncement(
        "Bem vindo a FTOH, espere a corrida acabar para entrar na pista! Use o comando '!ajuda' para ver mais comandos.",
        player.id,
        colors.info,
        fonts.info,
        sounds.info
      );
    }
  };

  room.onPlayerLeave = function (player) {
    console.log(`${player.name} has left`);

    // Verifica se o jogador estava na lista e, se sim, atualiza suas informações
    if (playerList[player.name]) {
      // Atualiza as informações do jogador
      playerList[player.name].currentLap = 0;
      playerList[player.name].lapChanged = false;
      playerList[player.name].inSafetyCar = false;
      playerList[player.name].kers = 0
      playerList[player.name].isInTheRoom = false;
      playerList[player.name].isInTheTrack = false;
      playerList[player.name].wear = 0;
      playerList[player.name].adminSec = false;

      // Remove o jogador da lista de jogadores
      delete playerList[player.name];
    }

    let players = room.getPlayerList();

    // Verifica se o jogo está em andamento e não há mais jogadores na sala
    if (room.getScores() != null && players.length == 0) {
      room.stopGame();
      console.log("Game stopped due to no players remaining");
    }
  };

  room.onPlayerTeamChange = function (changedPlayer, byPlayer) {
    byPlayer == null
      ? console.log(
          `${changedPlayer.name} was moved to ${teams[changedPlayer.team]}`
        )
      : console.log(
          `${changedPlayer.name} was moved to ${teams[changedPlayer.team]} by ${
            byPlayer.name
          }`
        );
    console.log(changedPlayer);
    if (changedPlayer.team != 0) {
      playerList[changedPlayer.name].isInTheTrack = true;
    } else {
      playerList[changedPlayer.name].isInTheTrack = false;
    }

    if (changedPlayer.team == 1) {
      playerList[changedPlayer.name].tyres = null;
      const randomEmoji = getRandomEmoji();
      room.setPlayerAvatar(changedPlayer.id, randomEmoji);
    }

    if (changedPlayer.team == 2) {
      playerList[changedPlayer.name].tyres = "macios";
      room.setPlayerAvatar(changedPlayer.id, "🔴");
    }

    // changedPlayer.team != 0 ? playerList[changedPlayer.name].isInTheTrack = false : playerList[changedPlayer.name].isInTheTrack = true;
    playerList[changedPlayer.name].currentLap = 0;
    playerList[changedPlayer.name].lapChanged = false;
  };

  room.onPositionsReset = function () {
    let players = room.getPlayerList();
    players.forEach((p) => {
      playerList[p.name].currentLap = 0;
      playerList[p.name].lapChanged = false;
      for (let l = 0; l < playerList[p.name].lapTimes.length; l++) {
        playerList[p.name].lapTimes[l] = 0;
      }
    });
  };

  room.onRoomLink = function (url) {
    if (isRoomSet == false) {
      console.log(`Room set with url: ${url}`);
      isRoomSet = true;
    }
  };

  room.onStadiumChange = function (newStadiumName, byPlayer) {
    byPlayer == null
      ? console.log(`${newStadiumName} was loaded`)
      : console.log(`${newStadiumName} was loaded by ${byPlayer.name}`);

    let c = _Circuits.find((x) => x.Name == newStadiumName);
    let players = room.getPlayerList();
    let admins = room.getPlayerList().filter((p) => p.admin == true);

    players.forEach((p) => {
      if (playerList[p.name].afk != true) {
        room.setPlayerTeam(p.id, c.Team);
      }
    });

    if (byPlayer == null) {
      if (c) {
        _Circuit = {
          MinX: c.MinX,
          MaxX: c.MaxX,
          MinY: c.MinY,
          MaxY: c.MaxY,
          LaneMinX: c.LaneMinX,
          LaneMaxX: c.LaneMaxX,
          LaneMinY: c.LaneMinY,
          LaneMaxY: c.LaneMaxY,
          BoxMinX: c.BoxMinX,
          BoxMaxX: c.BoxMaxX,
          BoxMinY: c.BoxMinY,
          BoxMaxY: c.BoxMaxY,
          DriveDirection: c.DriveDirection,
          StartDirection: c.StartDirection,
          Name: c.Name,
          BestTime: [c.BestTime[0], c.BestTime[1]],
          MainColor: c.MainColor,
          AvatarColor: c.AvatarColor,
          Angle: c.Angle,
          Team: c.Team,
          Limit: c.Limit,
          ID: c.ID,
        };
        limit = c.Limit ? c.Limit : 10;
        room.setTeamColors(c.Team, c.Angle, c.AvatarColor, c.MainColor);
      } else {
        admins.length > 0
          ? admins.forEach((p) =>
              room.sendAnnouncement(
                `Something went wrong with map ${newStadiumName}. Please try again!`,
                p.id,
                colors.wrong,
                fonts.wrong,
                sounds.wrong
              )
            )
          : room.sendAnnouncement(
              `Something went wrong with map ${newStadiumName}. Please call an admin to try again!`,
              null,
              colors.wrong,
              fonts.wrong,
              sounds.wrong
            );
      }
    } else {
      room.sendAnnouncement(
        "You don't have authorization to change maps in this room!",
        byPlayer.id,
        colors.wrong,
        fonts.wrong,
        sounds.wrong
      );
      room.setCustomStadium(Circuits[0]);
    }
  };
